Когда девушки расказывают, что "у мужиков одно на уме", они даже не представляют, сколько у нас на уме: 
— как дожить до зарплаты; 
— как тр@хнуть соседку; 
— как заставить детей хорошо учиться; 
— как тр@хнуть бывшую одноклассницу; 
— как свалить "ненавистный режим"; 
— как тр@хнуть бухгалтершу; 
— как взять кредит, чтобы дали, а потом кинуть банк; 
— как тр@хнуть ну, ту, с которой каждый день на остановке автобуса встречаешься; 
— как предотвратить возможное столкновение Земли с астероидом; 
— кого тр@хнуть в первую очередь, если такое столкновение неизбежно; 
— и. т. д. и. т. п. 
А вы говорите — "примитивное создание". Обидно.

